style.css:
@-moz-document domain("my3cx.fr") {
.grid-group-item {
  margin: 5px;
  border: 1px;
  padding: 5px;
  border: 1px grey solid;
  border-radius: 30px;
}

.avatar-circle {
  border: 1px;
  border-radius: 25px;
  z-index: 11;
}

.avatar > .ng-star-inserted:nth-child(1) {
  border: 1px;
  border-radius: 25px;
  z-index: 11;
}

.grid-group-item .avatar {
  margin-right: 10px !important;
}

.grid-group-item > .align-self-end {
  margin: 0;
}

.grid-group-item .big {
  width:200%;
  height: 3px;
  z-index: 0;
  left: 25px !important;
  overflow: hidden;
}

.grid-group-item .avatar-circle {
  background-color: grey;
}
}
